//www.mikeparanoid.com/blog/2022-10-02/":{"tf":1.0}},"df":1}}}},"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"t":{"docs":{},"df":0,"e":{"docs":{"//www.mikeparanoid.com/blog/2022-10-02/":{"tf":1.7320508075688772}},"df":1},"t":{"docs":{},"df":0,"e":{"docs":{},"df":0,"n":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}}}}},"y":{"docs":{},"df":0,"e":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}}}},"title":{"root":{"docs":{},"df":0,"b":{"docs":{},"df":0,"l":{"docs":{},"df":0,"o":{"docs":{},"df":0,"g":{"docs":{"//www.mikeparanoid.com/blog/2022-10-02/":{"tf":1.0}},"df":1}}}},"f":{"docs":{},"df":0,"o":{"docs":{},"df":0,"o":{"docs":{},"df":0,"t":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}},"g":{"docs":{},"df":0,"u":{"docs":{},"df":0,"n":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}},"k":{"docs":{},"df":0,"e":{"docs":{},"df":0,"e":{"docs":{},"df":0,"p":{"docs":{},"df":0,"a":{"docs":{},"df":0,"s":{"docs":{},"df":0,"s":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}}}}},"m":{"docs":{},"df":0,"y":{"docs":{},"df":0,"s":{"docs":{},"df":0,"e":{"docs":{},"df":0,"l":{"docs":{},"df":0,"f":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}}}},"s":{"docs":{},"df":0,"e":{"docs":{},"df":0,"t":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}},"t":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"t":{"docs":{"//www.mikeparanoid.com/blog/2022-10-02/":{"tf":1.0}},"df":1}}}}},"t":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"p":{"docs":{"//www.mikeparanoid.com/blog/2022-10-04/":{"tf":1.0}},"df":1}}}}}}},"documentStore":{"save":true,"docs":{"//www.mikeparanoid.com/":{"body":"","id":"//www.mikeparanoid.com/","title":""},"//www.mikeparanoid.com/blog/":{"body":"","id":"//www.mikeparanoid.com/blog/","title":""},"//www.mikeparanoid.com/blog/2022-10-02/":{"body":"\nSo I have wanted to start a personal blog now for a while as a place for me both document the projects that I build, but also to practice writing. I am also hoping that this blog will make me more accountable so that I start spending more of my spare time making things and being productive, instead of being endlessly distracted on the internet.\nI am aware that it is standard for a programmer to have a blog. Many successful and well known programmers that I want to be like have a blog (or are they well known because they have a blog?), and I am a firm believer in shamelessly copying what successful people do until you have your own feel for it.\nI am also well aware that no one may ever read this and that I could be talking to the void, but I do not mind. I think that the act and discipline of writing and maintaining this blog will be well worth the effort in the end, no matter what happens. I will get better at writing and communicating, as well as learning some webdev stuff, so a win in any regard. Maybe I will learn something about myself too in this process, who knows? I will be fun either way.\n","id":"//www.mikeparanoid.com/blog/2022-10-02/","title":"Why I am starting a blog"},"//www.mikeparanoid.com/blog/2022-10-04/":{"body":"\nBackground\nI have been using Keepass for 6 years minimum now. When I first started using it was around the time I was learning how to program, and thus when I was learning how to use computers.\nThis meant that I was foolish and naive and thought I new everything (I doubt that much has changed) . So, in my awesome wisdom, I engineered a system with Keepass that was not fail-safe, and a system that was a massive foot-gun for my future self, which I recently shot myself with.\nSo at the time, I had set Keepass up with both a keyfile and a master password. I put the keyfile onto every device that I would use to access the database (work computer, university account, home computer, phone) and I then I would carry a USB that had the Keepass database on it. I would synch this USB onto a specific USB on my home PC, and I also would have an encrypted backup copy of this Database on my local PC. It seemed totaly logical to me then, to have only a single instance of the database, and spread multiple keys on whatever devices I would need.\nLong story short, I lost the Keepass USB I had at my Home PC when I moved house, then my PC hard drive failed (maybe something to do with the move?), and then I lost my wallet a few days later. Within the space of a week I lost all my passwords and the backups! What a bloody disaster! \nYou can imagine the horror that I went through. After unpacking, the USB did not turn up, I called every cop-shop to see if my wallet turned up. Nope, it had not. \nRecovery\nLuckily, I could reset the password for my main Google account via text message, which then I slowly could reset passwords to all the services that I use daily that I am happy to be identified with: bank, phone, Amazon, eBay, etc. Also, my \"main\" junk emails that I use for social media, Steam, etc. are recoverable through this main email account. \nSlowly, I was able to work my way through my main email and recover about 25% of lost accounts. The most difficult was recovering my Github account because I had no access to the registered email account, but I still had access to SSH keys on my laptop that I used to verify my account, and reset the passwords (good on Microsoft for having decent support on the Github team). \nTrying to keep a positive outlook: I got a free spring-cleaning of my password database. I have been using single-use email address for many random services and I did not even remember what half of them were used for, so losing access to these services was no big deal. \nWhat I have learned.\nWhat I learned is to no longer assume things, and that I should engineer even against the improbable. Million-to-one odds happen every 9 in 10 hey.\nSo for the  next iteration of my Keepass password, I have decided to go the opposite route: I store the password database in a single location (currently on Google Drive) that I keep synced on all devices that I want to have access on. I might even see if I can host this on a website or Cloud device, so that only ever \"see\" a single version of the database, and thus not have to think about keeping any database synchronised.\nThen, on my USB drives, I keep the key file. I now still have a USB on my computer desk as a backup, but I also have written down the key file and have this piece of paper filed away as a last-resort backup.\nThus, the only even that I cause me total loss if I somehow loose all the USBs, and key-paper at once (which has made me realise that I vulnerable to house fire, so I now also store a copy of the key at my work office). Or if Google decide to kick me off their platform, which is actually a concern. Maybe it is time to look at a viable alternative to Google for email and cloud storage ... great idea for a quick project!\n","id":"//www.mikeparanoid.com/blog/2022-10-04/","title":"Tripping a Foot-gun I Set For Myself: Keepass. "},"//www.mikeparanoid.com/projects/":{"body":"","id":"//www.mikeparanoid.com/projects/","title":""}},"docInfo":{"//www.mikeparanoid.com/":{"body":0,"title":0},"//www.mikeparanoid.com/blog/":{"body":0,"title":0},"//www.mikeparanoid.com/blog/2022-10-02/":{"body":89,"title":2},"//www.mikeparanoid.com/blog/2022-10-04/":{"body":352,"title":6},"//www.mikeparanoid.com/projects/":{"body":0,"title":0}},"length":5},"lang":"English"};